import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <nav>
        <div className="banner">
        </div>
        <ul>
          <li>
            <Link to="/">Flashcard</Link>
          </li>
          <li>
            <Link to="/boobPage">Boob Page</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
